import "./style.css";
import Navbtn from "./component/Navbtn";

function App() {
  return (
    <nav className="navbar">
      <Navbtn text="Home" btnName="navbarBtn" clickHandler="navHandler" />
      <Navbtn text="Skills" btnName="navbarBtn" clickHandler="navHandler" />
      <Navbtn text="Projects" btnName="navbarBtn" clickHandler="navHandler" />
      <Navbtn text="Socials" btnName="navbarBtn" clickHandler="navHandler" />
    </nav>
  );
}

export default App;
